  Button,
} from "react-bootstrap";
const Addadminusers = () => {
  return (
    <>
       <div className="Tabs_container">
        <div className="Tabs_content text-start p-4">
          <h4>Add New Admin Users</h4>
            
        </div>
      </div>
    </>
  );
}

export default Addadminusers;
